/**
 * 智能受理案件模块路由
 */
const routers = [
  {
    path: 'znsa',
    name: 'znsa',
    component: () => import('@/views/zhajgl/znsa/index'),
    meta: { title: '智能受案', icon: 'iconfont icon-dian' },
  },
  {
    path: 'details/:id',
    name: 'details',
    component: () => import('@/views/zhajgl/znsa/details/index'),
    meta: { title: '智能受案详情', icon: 'iconfont icon-dian' },
    hidden: true
  },
  {
    path: 'znla',
    name: 'znla',
    redirect: 'znla/laqk',
    component: () => import('@/views/zhajgl/znla/index'),
    meta: { title: '智能轮案', icon: 'iconfont icon-dian' },
    children: [
      {
        path: 'ajlb',
        name: 'ajlb',
        component: () => import('@/views/zhajgl/znla/ajlb/index'),
        meta: { title: '案件列表', icon: 'iconfont' },
      },
      {
        path: 'laqk',
        name: 'laqk',
        component: () => import('@/views/zhajgl/znla/laqk/index'),
        meta: { title: '轮案情况查询', icon: 'iconfont' },
      },
      {
        path: 'cjzmbl',
        name: 'cjzmbl',
        component: () => import('@/views/zhajgl/znla/cjzmbl/index'),
        meta: { title: '常见罪名办理查询', icon: 'iconfont' },
      },
      {
        path: 'cjzmbl/:id',
        name: 'cjzmblId',
        component: () => import('@/views/zhajgl/znla/cjzmbl/index'),
        meta: { title: '常见罪名办理查询', icon: 'iconfont' },
        hidden: true
      },
      {
        path: 'txalfp',
        name: 'txalfp',
        component: () => import('@/views/zhajgl/znla/txalfp/index'),
        meta: { title: '特性案例分配', icon: 'iconfont' },
      },
    ]
  },
  {
    name: 'znsonga',
    path: 'znsonga',
    redirect: 'znsonga/sendCase',
    component: () => import('@/views/zhajgl/znsonga/index'),
    meta: { title: '智能送案', icon: 'iconfont icon-dian' },
    children: [
      {
        path: 'sendCase',
        name: 'sendCase',
        component: () => import('@/views/zhajgl/znsonga/sendCase/index'),
        meta: { title: '送案提醒', icon: 'iconfont' },
      },
      {
        path: 'putCase',
        name: 'putCase',
        component: () => import('@/views/zhajgl/znsonga/putCase/index'),
        meta: { title: '收案提醒', icon: 'iconfont' },
      },
      {
        path: 'infoList',
        name: 'infoList',
        component: () => import('@/views/zhajgl/znsonga/infoList/index'),
        meta: { title: '消息列表', icon: 'iconfont' },
      },
    ]
  },
  {
    name: 'sfda',
    path: 'sfda',
    redirect: '/zhajgl/sfda/admin',
    component: () => import('@/views/zhajgl/sfda/index'),
    meta: { title: '检察官司法档案', icon: 'iconfont icon-dian' },
    children: [
      {
        path: 'admin',
        name: 'admin',
        component: () => import('@/views/zhajgl/sfda/admin/index'),
        meta: { title: '管理员', icon: 'iconfont' },
      },
      {
        path: 'admin/details',
        name: 'adminDetails',
        component: () => import('@/views/zhajgl/sfda/admin/details'),
        meta: { title: '司法档案', icon: 'iconfont' },
        hidden: true
      },
      {
        path: 'admin/gongshi',
        name: 'gongshi',
        component: () => import('@/views/zhajgl/sfda/admin/gongshi'),
        meta: { title: '档案公示', icon: 'iconfont' }
      },
      {
        path: 'entry',
        name: 'entry',
        component: () => import('@/views/zhajgl/sfda/entry/index'),
        meta: { title: '录入员', icon: 'iconfont' },
      },
      {
        path: 'entry/details',
        name: 'entryDetails',
        component: () => import('@/views/zhajgl/sfda/entry/details'),
        meta: { title: '司法档案', icon: 'iconfont' },
        hidden: true
      }
    ]
  },
  {
    name: 'ajgkznsc',
    path: 'ajgkznsc',
    component: () => import('@/views/zhajgl/ajgkznsc/index'),
    meta: { title: '案件公开智能审查', icon: 'iconfont icon-dian' },
    children: [{
      path: 'ajgkznsc/list',
      name: 'ajgkznscList',
      component: () => import('@/views/zhajgl/ajgkznsc/list/index'),
      meta: { title: '文书列表', icon: 'iconfont' }
    },
    {
      path: 'ajgkznsc/details',
      name: 'ajgkznscDetails',
      component: () => import('@/views/zhajgl/ajgkznsc/details/index'),
      meta: { title: '文书详情', icon: 'iconfont' },
      hidden: true
    },
    {
      path: 'ajgkznsc/pingbi',
      name: 'pingbi',
      component: () => import('@/views/zhajgl/ajgkznsc/pingbi/index'),
      meta: { title: '屏蔽字段配置', icon: 'iconfont' }
    }]
  },
  {
    path: 'ajfxyp',
    name: 'ajfxyp',
    component: () => import('@/views/zhajgl/ajfxyp/index'),
    meta: { title: '案件分析研判', icon: 'iconfont icon-dian' },
    children: [
      {
        path: 'dzjz',
        name: 'dzjz',
        component: () => import('@/views/zhajgl/ajfxyp/dzjz/index'),
        meta: { title: '电子卷宗', icon: 'iconfont' },
      },
      {
        path: 'gkqk',
        name: 'gkqk',
        component: () => import('@/views/zhajgl/ajfxyp/gkqk/index'),
        meta: { title: '公开情况', icon: 'iconfont' },
      },
      {
        path: 'sacw',
        name: 'sacw',
        component: () => import('@/views/zhajgl/ajfxyp/sacw/index'),
        meta: { title: '涉案财物', icon: 'iconfont' },
      },
      {
        path: 'lsbhr',
        name: 'lsbhr',
        component: () => import('@/views/zhajgl/ajfxyp/lsbhr/index'),
        meta: { title: '律师辩护人', icon: 'iconfont' },
      },
    ]
  },
  {
    path: 'jxkh',
    name: 'jxkh',
    component: () => import('@/views/zhajgl/jxkh/index'),
    meta: { title: '绩效考核', icon: 'iconfont icon-dian' },
    children: [
      {
        path: 'jxkh',
        name: 'jxkh',
        component: () => import('@/views/zhajgl/jxkh/jxkh/index'),
        meta: { title: '绩效考核', icon: 'iconfont' },
      },
      {
        path: 'jxxq/:id',
        name: 'jxxq',
        component: () => import('@/views/zhajgl/jxkh/xqym/index'),
        meta: { title: '绩效详情', icon: 'iconfont' },
        hidden: true
      },
    ]
  },
  {
    path: 'bada',
    name: 'bada',
    component: () => import('@/views/zhajgl/bada/index'),
    meta: { title: '入院领导办案档案', icon: 'iconfont icon-dian' },
    children: [
      {
        path: 'dagl',
        name: 'dagl',
        component: () => import('@/views/zhajgl/bada/dagl/index'),
        meta: { title: '档案管理', icon: 'iconfont' },
      },
    ]
  },
]
export default routers
